import "./NavBar.css";
import NavLink from 'react-router-dom'
const NavBar = () => {
  return (
    <>
      <div className="navbar">
        <div className="logo">
          <NavLink></NavLink><h1>QuotesApp</h1>
        </div>
        <div className="buttons"></div>
      </div>
    </>
  );
};

export default NavBar;
